// create two boxes and a ground
var cloth = Composites.stack(0, 0, 60, 40, 0,0, function(x, y) {
  
  return Bodies.circle(x, y, 3, {
    collisionFilter: {
      category: -1,
      mask: -1,
      group: -1,

    },
    render: {
      //fillStyle: `rgb(${pixel[0]}, ${pixel[1]}, ${pixel[2]})`,

    }
  });
});
for (let i=0; i<cloth.bodies.length; i++) {
  const x = i % 60;
  const y = Math.floor(i / 60);
  console.log(pixel_data[y]);
  const pixel = pixel_data[y][x];
  cloth.bodies[i].render.fillStyle = `rgb(${pixel[0]}, ${pixel[1]}, ${pixel[2]})`;
}
cloth = Composites.mesh(cloth, 60, 40, false);
var anchor = Bodies.rectangle(0, 0, 800, 10, {isStatic: true});
var anchorConstraints = []

for (let i=0; i<60; i++) {
  cloth.bodies[i].isStatic = true;
  var constraint = Matter.Constraint.create({
    bodyA: cloth.bodies[cloth.bodies.length - 1 - i],
    length: 0,
    bodyB: anchor,
    render: {
      visible: true,
    }
  })
  anchorConstraints.push(constraint);
  
}



var ground = Bodies.rectangle(400, 610, 810, 60, { isStatic: true });
Composite.add(engine.world, [cloth, ground, anchor, ...anchorConstraints]);

var mouse = Mouse.create(render.canvas);


var mouseConstraint = MouseConstraint.create(engine, {
  mouse: mouse,
  constraint: {
    stiffness: 0.98,
    render: {
      visible: false
    },
  }
});

